import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

const Home = () => {
  const navigate = useNavigate();
  const [locations, setLocations] = useState([]);
  const [search, setSearch] = useState({
    location: '',
    checkIn: '',
    checkOut: '',
    guests: 1,
  });

  useEffect(() => {
    const fetchLocations = async () => {
      try {
        const res = await axios.get(`${process.env.REACT_APP_API_URL}/api/listings/locations`);
        console.log('Locations response:', res.data);
        setLocations(res.data);
      } catch (err) {
        console.error('Error fetching locations:', err.response?.data || err.message);
      }
    };
    fetchLocations();
  }, []);

  const handleSearchChange = (e) => {
    const { name, value } = e.target;
    setSearch((prev) => ({ ...prev, [name]: value.trim() }));
  };

  const handleSearchSubmit = (e) => {
    e.preventDefault();
    console.log('Submitting search query:', search);
    const query = new URLSearchParams({
      location: search.location,
      checkIn: search.checkIn,
      checkOut: search.checkOut,
      guests: search.guests,
    }).toString();
    navigate(`/locations?${query}`);
  };

  return (
    <div className="space-y-12">
      <div
        className="relative bg-cover bg-center h-64 flex justify-center items-center"
        style={{ backgroundImage: `url(/images/hero.jpg)`, height: 600 }}
      >
        <form
          onSubmit={handleSearchSubmit}
          className="search-bar flex items-center w-full max-w-3xl h-16 bg-white rounded-full p-2 pl-8 gap-4 shadow-md max-md:flex-col max-md:h-auto max-md:p-4 max-md:rounded-2xl"
        >
          <div className="search-option flex flex-col flex-1 max-md:w-full">
            <strong className="font-bold mb-1">Location</strong>
            <select
              name="location"
              value={search.location}
              onChange={handleSearchChange}
              className="border-none outline-none text-sm text-gray-600 w-full"
            >
              <option value="">Any Location</option>
              {locations.map((loc) => (
                <option key={loc} value={loc}>{loc}</option>
              ))}
            </select>
          </div>
          <div className="search-option flex flex-col flex-1 max-md:w-full">
            <strong className="font-bold mb-1">Check in</strong>
            <input
              type="date"
              name="checkIn"
              value={search.checkIn}
              onChange={handleSearchChange}
              className="border-none outline-none text-sm text-gray-600 w-full"
            />
          </div>
          <div className="search-option flex flex-col flex-1 max-md:w-full">
            <strong className="font-bold mb-1">Check out</strong>
            <input
              type="date"
              name="checkOut"
              value={search.checkOut}
              onChange={handleSearchChange}
              className="border-none outline-none text-sm text-gray-600 w-full"
            />
          </div>
          <div className="search-option flex flex-col flex-1 max-md:w-full">
            <strong className="font-bold mb-1">Guests</strong>
            <input
              type="number"
              name="guests"
              value={search.guests}
              onChange={handleSearchChange}
              min="1"
              className="border-none outline-none text-sm text-gray-600 w-full"
            />
          </div>
          <button
            type="submit"
            className="bg-red-500 text-white w-9 h-9 rounded-full flex items-center justify-center hover:bg-red-600 max-md:w-12 max-md:h-12"
          >
            üîç
          </button>
        </form>
      </div>

      <section className="container mx-auto px-4">
        <h2 className="text-3xl font-bold mb-6">Inspiration for your next trip</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          {[
            { city: 'Paris', image: '/images/paris.jpg' },
            { city: 'Tokyo', image: '/images/tokyo.jpg' },
            { city: 'New York', image: '/images/new-york.jpg' },
          ].map(({ city, image }) => (
            <div key={city} className="border rounded-lg overflow-hidden shadow">
              <img src={image} alt={city} className="w-full h-48 object-cover" />
              <div className="p-4">
                <h3 className="text-xl font-semibold">{city}</h3>
                <p className="text-gray-600">Discover amazing stays.</p>
              </div>
            </div>
          ))}
        </div>
      </section>

      <section className="bg-gray-100 py-12">
        <div className="container mx-auto px-4">
          <h2 className="text-3xl font-bold mb-6">Discover Experiences</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="border rounded-lg overflow-hidden shadow">
              <img src="/images/online-experiences.jpg" alt="Online Experiences" className="w-full h-48 object-cover" />
              <div className="p-4">
                <h3 className="text-xl font-semibold">Online Experiences</h3>
                <Link to="/locations" className="text-red-500 hover:underline">Learn more</Link>
              </div>
            </div>
            <div className="border rounded-lg overflow-hidden shadow">
              <img src="/images/in-person-experiences.jpg" alt="In-Person Experiences" className="w-full h-48 object-cover" />
              <div className="p-4">
                <h3 className="text-xl font-semibold">In-Person Experiences</h3>
                <Link to="/locations" className="text-red-500 hover:underline">Learn more</Link>
              </div>
            </div>
          </div>
        </div>
      </section>

      <section className="container mx-auto px-4">
        <div className="flex flex-col md:flex-row items-center">
          <div className="md:w-1/2">
            <h2 className="text-3xl font-bold mb-4">Shop Airbnb gift cards</h2>
            <Link to="#" className="bg-red-500 text-white px-6 py-3 rounded-full hover:bg-red-600">
              Shop now
            </Link>
          </div>
          <img src="/images/gift-card.jpg" alt="Gift Cards" className="md:w-1/2 h-64 object-cover rounded" />
        </div>
      </section>

      <section className="bg-gray-100 py-12">
        <div className="container mx-auto px-4">
          <h2 className="text-3xl font-bold mb-6">Plan your future getaways</h2>
          <div className="tabs">
            {['Beaches', 'Cities', 'Mountains'].map((tab) => (
              <button key={tab} className="px-4 py-2 mr-2 bg-white rounded-full hover:bg-gray-200">
                {tab}
              </button>
            ))}
          </div>
          <div className="mt-6 grid grid-cols-1 md:grid-cols-3 gap-6">
            {[
              { place: 'Miami', image: '/images/miami.jpg' },
              { place: 'London', image: '/images/london.jpg' },
              { place: 'Alps', image: '/images/alps.jpg' },
            ].map(({ place, image }) => (
              <div key={place} className="border rounded-lg overflow-hidden shadow">
                <img src={image} alt={place} className="w-full h-48 object-cover" />
                <div className="p-4">
                  <h3 className="text-xl font-semibold">{place}</h3>
                  <p className="text-gray-600">Book now.</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
